        <AppBar position="static" color="inherit">
          <Typography
            variant="h2"
            align="center">
            Post Box
          </Typography>
        </AppBar>
        <PostMessages />
        <ButterToast position={{vertical:POS_TOP,horizontal:POS_RIGHT}}/>
      </Container>
    </Provider>
  );
}

export default App;
